function select_all() {
    for (let j = 0, len = 11; j < len; j++) {
        let id = j+1;
        document.getElementById("checkbox"+id).checked = true;
        toggleLabel("checkbox"+id,"label"+id,"slider"+id,"slider_"+id+"_value");
    }
}

function deselect_all() {
    for (let j = 0, len = 11; j < len; j++) {
        let id = j+1;
        document.getElementById("checkbox"+id).checked = false;
        toggleLabel("checkbox"+id,"label"+id,"slider"+id,"slider_"+id+"_value");
    }
}

function toggleLabel(checkboxId, labelId, slider_value,slider_val_id) {
  let checkbox = document.getElementById(checkboxId);
  let label = document.getElementById(labelId);
  let slider_val = document.getElementById(slider_val_id);
  if (checkbox.checked) {
    label.style.color = "black";
    slider_val.style.color = "black";
  } else {
    label.style.color = "gray";
    slider_val.style.color = "gray";
  }
}

function change_year(year){
    document.getElementById("yearofstudy").innerHTML = year;
    if (year == 2024 || year == "Year") {
        document.getElementById("perfect_button").innerHTML = "";
    }
    else if (year == 2023){
        document.getElementById("perfect_button").innerHTML = "<button onclick='perfect_settings() ; find_winner()' class='ML_button'>Perfect</button>";
    }
    else if (year == 2022){
        document.getElementById("perfect_button").innerHTML = "<button onclick='perfect_settings() ; find_winner()' class='ML_button'>Perfect</button>";
    }
    else if (year == 2021){
        document.getElementById("perfect_button").innerHTML = "<button onclick='perfect_settings() ; find_winner()' class='ML_button'>Perfect</button>";
    }
    else if (year == 2019){
        document.getElementById("perfect_button").innerHTML = "<button onclick='perfect_settings() ; find_winner()' class='ML_button'>Perfect</button>";
    }
    else if (year == 2018){
        document.getElementById("perfect_button").innerHTML = "<button onclick='perfect_settings() ; find_winner()' class='ML_button'>Perfect</button>";
    }
}

function set_slider_val(weight,id){
    let name = "checkbox" + id;
    let slider_name = "slider" + id;
    let checkbox = document.getElementById(name);
    if (checkbox.checked) {
        weight = document.getElementById(slider_name).value;
    }
    else {
        weight = 0;
    }
    return weight
}

